import React, { useEffect } from "react";
import '../../component/grid.css';
import homeStyles from '../home/home.module.css';
import '../../component/style.css';
import updateCartCount from '../updateCartCount';
import banner_home_1 from '../img/banner_home_1.jpg';
import banner_home_2 from '../img/banner_home_2.jpg';
import banner_home_3 from '../img/banner_home_3.jpg';
import banner_home_4 from '../img/banner_home_4.jpg';
import TruyenTheoQuangCao from "../truyentheoquangcao";
import RenderTruyen from "../RenderTruyen";

const Home = () => {
    useEffect(() => {
        updateCartCount();
    }, []);

    const maQuangCao1 = 'QC001';
    const maQuangCao2 = 'QC002';
    const maQuangCao3 = 'QC003';
    const maQuangCao4 = 'lb7ssmtf';
    const maQuangCao5 = 'lbmcb1jd';
    const maQuangCao6 = 'lbwst2lr';
    const maQuangCao7 = 'lc4ymoui';
    const maQuangCao8 = 'lcf1sre5';
    const maQuangCao9 = 'lcr3g6f2';

    const { truyens: qc1Data, tenquangcao: tenQC1 } = TruyenTheoQuangCao({ maquangcao: maQuangCao1 });
    const { truyens: qc2Data, tenquangcao: tenQC2 } = TruyenTheoQuangCao({ maquangcao: maQuangCao2 });
    const { truyens: qc3Data, tenquangcao: tenQC3 } = TruyenTheoQuangCao({ maquangcao: maQuangCao3 });
    const { truyens: qc4Data, tenquangcao: tenQC4 } = TruyenTheoQuangCao({ maquangcao: maQuangCao4 });
    const { truyens: qc5Data, tenquangcao: tenQC5 } = TruyenTheoQuangCao({ maquangcao: maQuangCao5 });
    const { truyens: qc6Data, tenquangcao: tenQC6 } = TruyenTheoQuangCao({ maquangcao: maQuangCao6 });
    const { truyens: qc7Data, tenquangcao: tenQC7 } = TruyenTheoQuangCao({ maquangcao: maQuangCao7 });
    const { truyens: qc8Data, tenquangcao: tenQC8 } = TruyenTheoQuangCao({ maquangcao: maQuangCao8 });
    const { truyens: qc9Data, tenquangcao: tenQC9 } = TruyenTheoQuangCao({ maquangcao: maQuangCao9 });

    return (
        <>
            <RenderTruyen
                truyens={qc1Data.slice(0, 5)}
                tieude={tenQC1}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <RenderTruyen
                truyens={qc2Data.slice(0, 5)}
                tieude={tenQC2}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <RenderTruyen
                truyens={qc3Data.slice(0, 5)}
                tieude={tenQC3}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <img className={homeStyles['img-title']} src={banner_home_1} alt="Banner 1" />
            <RenderTruyen
                truyens={qc4Data.slice(0, 5)}
                tieude={tenQC4}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <img className={homeStyles['img-title']} src={banner_home_2} alt="Banner 2" />
            <RenderTruyen
                truyens={qc5Data.slice(0, 5)}
                tieude={tenQC5}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />


            <img className={homeStyles['img-title']} src={banner_home_3} alt="Banner 3" />
            <RenderTruyen
                truyens={qc6Data.slice(0, 5)}
                tieude={tenQC6}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <img className={homeStyles['img-title']} src={banner_home_4} alt="Banner 4" />
            <RenderTruyen
                truyens={qc7Data.slice(0, 5)}
                tieude={tenQC7}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <RenderTruyen
                truyens={qc8Data.slice(0, 5)}
                tieude={tenQC8}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />

            <RenderTruyen
                truyens={qc9Data.slice(0, 5)}
                tieude={tenQC9}
                on_xemthem={false}
                on_phantrang={false}
                soLuongHienThi={5}
            />
        </>
    );
}

export default Home;
